import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Header from './Header';
import ProfilePage from './ProfilePage';
import RestaurantSearch from './RestaurantSearch'; // Import your existing component

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Route path="/profile" component={ProfilePage} /> {/* Add the route */}
        <Route exact path="/" component={RestaurantSearch} /> {/* Add your existing component */}
      </div>
    </Router>
  );
};

export default App;
